import React from "react";
import Header from "../../components/Header/Header";
import Layouts from "../../components/Layouts/Layouts";
import { MainContent } from "../../components/MainContent/MainContent";

const Home: React.FC = () => {
  return (
    <Layouts>
      <Header />
      <MainContent>
        <div>Home page</div>
      </MainContent>
    </Layouts>
  );
};

export default Home;
